  const nastavnik = useSelector((state) => state.nastavnik);
  console.log(1234, nastavnik);
  const dispatch = useDispatch();

  return (
    <div>
      <p>{nastavnik.ime + ' ' + nastavnik.prezime}</p>
    </div>
  );
};

export default Nastavnik;
